<div class="entities" style="line-height: 2.5; direction: ltr">Influence of immunomodulatory drugs on the cytotoxicity induced by monoclonal antibody 17-1 A and interleukin - 2 . Patients treated with monoclonal antibodies and cytokines for cancer receive often co-medication , which may influence treatment efficacy . Therefore , we investigated with a flowcytometric cytotoxicity assay the effect of several immunomodulatory drugs on antibody dependent cellular cytotoxicity ( ADCC ) , interleukin - 2 (

</mark>
 ) induced cytotoxicity and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 - induced-ADCC . We found that dexamethasone markedly inhibited the

</mark>
 induced cytotoxicity and the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - induced-ADCC .

 - induced-ADCC . The

 , a novel atypical antipsychotic agent with high binding affinity for dopamine D2 , serotonin

 and

 receptors has been reported to have superior efficacy in rodents ' models of cognitive impairment . However , the beneficial effect of lurasidone on cognitive impairment has not been evaluated in non-human primates . In this study , we investigated the effect of lurasidone on executive function , which is one of the cognitive domains , in common marmosets and compared the results to those of other antipsychotics . The effects of lurasidone , haloperidol , olanzapine , risperidone , quetiapine and clozapine on executive function were evaluated in naïve marmosets using the object retrieval with detours ( ORD ) task . Before drug treatment , marmosets ' success rates in the easy trial of the test were almost 90 % . However , maximum success in the difficult trial of the task reached only 50 % after 8 days of training . DB00502 , olanzapine and risperidone decreased correct performance even in the easy trial of the task . All drugs , except lurasidone , impaired success rate in the difficult trial . On the other hand , lurasidone dose-dependently increased marmosets ' success rates in the difficult trial with significant effect at 10mg / kg . In conclusion , we have shown in this study that lurasidone , unlike conventional antipsychotics , improves cognition associated with executive function in common marmosets . These findings suggest that lurasidone would be more useful for treatment of schizophrenia cognitive impairment than other antipsychotics .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P43220
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 agonists for type 2 diabetes mellitus : recent developments and emerging agents . More than 26 million people in the United States have type 2 diabetes mellitus ( T2D ) . Many treatment options exist , but achieving long-term glycemic control in patients with T2D remains challenging . The glucagon-like peptide - 1 receptor agonists ( P0C6A0 RAs ) offer a treatment option that improves glycemic control and reduces weight , with a low risk of hypoglycemia . They have emerged as attractive options for the treatment of T2D , and significant advances and developments continue to be published regarding these agents . To identify relevant literature on emerging issues related to P0C6A0 RAs , a search of the MEDLINE database was performed . Studies published in English evaluating the safety and efficacy of P0C6A0 RAs were analyzed . Because of their advantages and unique mechanism of action , P0C6A0 RAs are currently being studied in new clinical areas , including in combination with basal insulin , as adjunctive therapy in type 1 diabetes , and for weight loss . In addition , there are several emerging agents in development . DB09265 is a once-daily P0C6A0 RA that targets postprandial glucose and may be most useful when added to basal insulin as an alternative to rapid-acting insulin . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB09043
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 and dulaglutide are once-weekly P0C6A0 RAs that may offer more convenient dosing . The most common adverse effects of all P0C6A0 RA agents are gastrointestinal ( e . g . , nausea , diarrhea , and vomiting ) , but the rates of occurrence vary among agents . Due to the differences in pharmacokinetics , efficacy , rates of adverse effects , and administration requirements within the P0C6A0 RA class , each agent should be evaluated independently . The future of P0C6A0 RAs offers broader treatment options for T2D as well as potential in other treatment areas .</div>

 agonists : stimulation of insulin secretion ( incretin effect ) and inhibition of glucagon secretion , both in a glucose-dependent manner , retardation of gastric emptying and increase of satiety . These effects lead to a reduction in glycated haemoglobin ( HbA ( 1c ) ) levels , combined with a weight reduction . The overall tolerance profile is good .

 is currently reimbursed in Belgium after failure ( HbA ( 1c ) &gt; 7.5 % ) of and in combination with a dual therapy with metformin and a sulfonylurea as well as in combination with a basal insulin ( with or without oral antidiabetic drugs ) . To avoid hypoglycaemia , a reduction in the dose of sulfonylurea or insulin may be recommended . A once-weekly administration should increase patient ' s acceptance of injectable therapy and improve compliance .</div>

 is a glucagon-like peptide - 1 analogue composed of tandem copies of modified human glucagon-like peptide - 1 ( 7-36 ) coupled to recombinant human albumin that is approved in adults for the treatment of type 2 diabetes mellitus . After subcutaneous administration , albiglutide is likely primarily absorbed via the lymphatic circulation , with maximum concentrations being reached in 3 to 5 days ; steady-state exposures are achieved following approximately 4 to 5 weeks of once-weekly administration . The elimination half-life of albiglutide is approximately 5 days . Clearance of albiglutide is 67 mL / h with between-subject variability of 34.9 % ; no covariates have been identified that would require dose adjustment of albiglutide .
